              </Route>
              <Route path="/home/">
                <GameTabs />
              </Route>
              <Route path="/game/live/">
                <BattingDash />
              </Route> */}
            </MainLayout>
          </div>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
